import React, { useState, useRef } from 'react';
import { Box, Accordion, AccordionSummary, AccordionDetails, Typography, ThemeProvider } from '@mui/material';
import { useParams } from 'react-router-dom';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';

// Define the color scheme based on your specifications
const colors = {
  background: '#EFEFEF',    // Light Gray (background)
  text: '#333333',          // Charcoal Gray (text)
  primary: '#0f1a22',       // Dark Slate Blue (primary)
  secondary: '#ffb6c1',     // Pastel Pink (secondary)
  accent: '#98fb98',        // Pastel Green (accent)
  cta: '#fdfd96',           // Pastel Yellow (call to action)
  accent2: '#c7a1ff',       // Pastel Purple (additional accent)
};

const PreDefinedPath = ({ pathways }) => {
  const { id } = useParams();
  const [list, setList] = useState(pathways[id].steps);
  const [expandedItem, setExpandedItem] = useState(null);

  const dragItem = useRef();
  const dragOverItem = useRef();

  const dragStart = (e, position) => {
    dragItem.current = position;
    console.log(e.target.innerHTML);
  };

  const dragEnter = (e, position) => {
    dragOverItem.current = position;
    console.log(e.target.innerHTML);
  };

  const drop = (e) => {
    const copyListItems = [...list];
    const dragItemContent = copyListItems[dragItem.current];
    copyListItems.splice(dragItem.current, 1);
    copyListItems.splice(dragOverItem.current, 0, dragItemContent);
    dragItem.current = null;
    dragOverItem.current = null;
    setList(copyListItems);
  };

  const toggleDetails = (itemIndex) => {
    if (expandedItem === itemIndex) {
      setExpandedItem(null);
    } else {
      setExpandedItem(itemIndex);
    }
  };

  return (
    <ThemeProvider theme={{ colors }}>
      <div style={{ minHeight: '100vh', display: 'flex', flexDirection: 'column', alignItems: 'center', justifyContent: 'center' }}>
        <div style={{ backgroundColor: colors.background, padding: '20px', textAlign: 'center', borderRadius: '10px', boxShadow: '0 0 10px rgba(0, 0, 0, 0.2)', marginBottom: '20px' }}>
          <h1 style={{ fontSize: '2rem', marginBottom: '10px', color: colors.primary }}>{pathways[id].title}</h1>
          <p style={{ fontSize: '1.2rem', marginBottom: '10px', color: colors.text }}>{pathways[id].desc}</p>
          <p style={{ fontSize: '1rem', color: colors.text }}>Average Pay: ${pathways[id].pay}</p>
        </div>

        <div style={{ width: '80%' }}>
          {list.map((item, index) => (
            <Box
              sx={{
                position: "relative",
                boxShadow: '0px 0px 5px rgba(0, 0, 0, 0.3)',
                transition: 'background-color 0.3s',
                '&:hover': {
                  backgroundColor: colors.secondary,
                },
                cursor: 'pointer',
                border: expandedItem === index ? `2px solid ${colors.accent}` : '2px solid transparent',
                display: 'flex',
                flexDirection: 'column',
                alignItems: 'center',
                justifyContent: 'center',
                padding: '10px',
                textAlign: 'left',
                color: colors.text,
              }}
              key={item.id}
              onDragStart={(e) => dragStart(e, index)}
              onDragEnter={(e) => dragEnter(e, index)}
              onDragEnd={drop}
              draggable
              onClick={() => toggleDetails(index)}
            >
              <h1 style={{ marginBottom: '10px' }}>{index + 1}</h1>
              {item.content}
              <Accordion expanded={expandedItem === index}>
                <AccordionSummary sx={{ backgroundColor: colors.cta, color: colors.text }}
                  expandIcon={<ExpandMoreIcon />}
                  onClick={(e) => {
                    e.stopPropagation();
                    toggleDetails(index);
                  }}
                >
                  <Typography variant="h6">Skills You'll Gain</Typography>
                </AccordionSummary>
                <AccordionDetails>
                  <ul className="skills-list">
                    {item.skills && item.skills.map((skill, skillIndex) => (
                      <li key={skillIndex}>
                        <strong>{skill.name}</strong>: {skill.description} ({skill.type})
                      </li>
                    ))}
                  </ul>
                </AccordionDetails>
              </Accordion>
            </Box>
          ))}
        </div>
      </div>
    </ThemeProvider>
  );
};

export default PreDefinedPath;
